import { Component, OnInit } from '@angular/core';

// @ts-ignore
import pdfMake from 'pdfmake/build/pdfmake';
// @ts-ignore
import pdfFonts from 'pdfmake/build/vfs_fonts';
import {Router} from "@angular/router";
pdfMake.vfs = pdfFonts.pdfMake.vfs;

class Product{
  name: string;
  price: number;
  qty: number;


  constructor() {

    this.name = "";
    this.price = 0;
    this.qty = 0;

  }
}
class Invoice{
  customerName: string;
  address: string;
  contactNo: number;
  project: string;

  products: Product[] = [];
  additionalDetails: string;
  taxInput: number;

  constructor(){
    // Initially one empty product row we will show

    this.products.push(new Product());
    this.address = "";
    this.additionalDetails = "";
    this.project = "";
    this.contactNo = 0;
    this.customerName = "";
    this.taxInput = 0;
  }
}

@Component({
  selector: 'app-invoice',
  templateUrl: './invoice.component.html',
  styleUrls: ['./invoice.component.css']
})
export class InvoiceComponent implements OnInit {
  private stack: (number | string)[] = [];
  display = '';

  ngOnInit(): void {
    this.display = '0';
    this.stack = ['='];
  }

  constructor(private _router: Router) {
  }

  invoice = new Invoice();

  generatePDF(action = 'open') {

    let docDefinition = {
      content: [
        {
          // you'll most often use dataURI images on the browser side
          // if no width/height/fit is provided, the original size will be used
          image: 'data:2;base64,',
          width: 520,
          height: 80
        },
        {text: "\n\n"},
        {
          text: 'KT-Kurier Clemensstr 113 80796 München',
          fontSize: 12,
          alignment: 'left',
          italics: true,
          decoration: 'underline',
          color: '#0070c0'
        },
        {text: "\n\n"},
        {
          columns: [
            [
              {
                text: this.invoice.customerName,
                italics: true,
                bold: true
              },
              {
                text: this.invoice.address,
                italics: true
              },
              {text: "\n\n\n"}
            ],
            [
              {text: "\n\n\n"},
              {text: "\n\n\n"},
              {
                text: `Date: ${new Date().toLocaleString()}`,
                alignment: 'right',
                italics: true
              }
            ]
          ]
        },
        {
          columns: [
            [
              {
                text: `RECHNUNG Nr.: ${((Math.random() * 1000).toFixed(0))}`,
                alignment: 'left',
                italics: true
              },
              {
                text: `Projekt : ${this.invoice.project}`,
                alignment: 'left',
                italics: true
              },
              {
                text: `Kundennummer : ${this.invoice.contactNo}`,
                alignment: 'left',
                italics: true
              },
              {text: "\n\n"}
            ],
          ],
        },
        /*{
          text: 'Megjegyzés, részletek',
          style: 'sectionHeader'
        },*/
        {
          text: this.invoice.additionalDetails,
          margin: [0, 0, 0, 15],
          italics: true
        },
        {
          table: {
            headerRows: 1,
            widths: ['auto', 'auto', 'auto', 'auto'],
            body: [
              ['Product', 'Price', 'Quantity', 'Amount'],
              ...this.invoice.products.map(p => ([p.name, p.price, p.qty, (p.price * p.qty).toFixed(2)])),
              [{
                text: 'Netto',
                colSpan: 3,
                italics: true,
                alignment: 'left'
              }, {}, {}, this.invoice.products.reduce((sum, p) => sum + (p.qty * p.price), 0).toFixed(2)],
              [{
                text: 'Brutto',
                colSpan: 3,
                italics: true,
                alignment: 'left'
              }, {}, {}, this.invoice.products.reduce((sum, p) => sum + (p.qty * p.price * (1 + (this.invoice.taxInput/100))), 0).toFixed(2)]
            ]
          },
          layout: 'noBorders',
          alignment: 'center',
          margin: [ 150, 0, 0, 0 ]

        },
        {text: "\n\n\n"},
        {
          text: "Besten Dank für den Auftrag und das mir entgegengebrachte Vertrauen.\n" +
            "Mit freundlichen Grüßen\n" +
            "Karl Trencsanyi\n\n\n\n\n\n\n\n\n\n",
          italics: true
        },
        {
          text: "Bankverbindung: Santander Bank IBAN: DE56500333002554759100 BIC: SCFBDE33XXX\n" +
            " Münchener Bank IBAN: DE36701900000200160555 BIC: GENODEF1MO1\n\n" +
            " Steuernummer : 148 /158 / 80650 Ust.IdNr.: DE217787709",
          italics: true,
          alignment: 'center',
        }
      ],
      styles: {
        sectionHeader: {
          bold: true,
          decoration: 'underline',
          fontSize: 14,
          margin: [0, 15, 0, 15],
          italics: true
        }
      }
    };

    if (action === 'download') {
      pdfMake.createPdf(docDefinition).download();
    } else if (action === 'print') {
      pdfMake.createPdf(docDefinition).print();
    } else {
      pdfMake.createPdf(docDefinition).open();
    }

  }

  addProduct() {
    this.invoice.products.push(new Product());
  }
}

